import React, { Component} from 'react';
import  InputRange  from './InputSlider';

class noValueSlider extends Component {
    // state = {
    //     value: 0
    // }
    handleOnChange = (e) => {
        const { value } = e.target;
        this.setState({ value });
    }
    render() {
        return (
            <form className="form">  
                <div className="row">
                    <div className="col-md-2">
                        <p>Enable</p>
                    </div>
                    <div className="col-md-7">
                        <div className="flex-div">
                            <InputRange min={0} max={100} value={0} value={value} onChange={this.handleOnChange}/>
                            <InputRange min={0} max={100} value={50} value={value} onChange={this.handleOnChange}/>
                            <InputRange min={0} max={100} value={100} value={value} onChange={this.handleOnChange}/>
                        </div>
                    </div>
                </div>
            </form>
        );
    }
}


export default noValueSlider;
